  \"2015-04-25T12:18:13.269015\",\n\t\"name\": \"halibut-change-analysis-commercial-fishery-north-central-region-ds1104\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were developed as part of the
  California North Central Coast Marine Protected Area Baseline Monitoring Project
  that is designed to characterize the ecological and socioeconomic conditions and
  changes within the North Central Coast Region since MPA implementation. The North
  Central Coast study region extends from the south at Pigeon Point to the north at
  Alder Creek. These data depict the spatial change in the stated relative value of
  commercial fishing grounds. The data were created by calculating the difference
  between data collected in the summer of 2007 (pre-MPAs) and in the spring of 2010
  (post-MPAs). Specifically, the data were produced by subtracting the post-MPA relative
  value surface data from the pre-MPA relative value surface data (x = pre-MPA - post-MPA).
  It is important to emphasize that only the relative value surfaces (also known as
  a 'heat map') were used in this analysis. In other words, ex-vessel revenue was
  not applied to the 'heat map' value surfaces, however ex-vessel revenue was used
  to weight the aggregated individual fishing grounds. This was done to reduce the
  number of variables which would influence analysis results. Thus, results are simply
  an examination of changes in the stated values/importance of fishing areas to a
  fishery and not spatial changes in revenue across the two datasets. The data ranges
  from negative to positive values on a relative scale. In this dataset the areas
  with negative values are areas where the post-MPA fishing relative values are greater
  than the pre-MPA relative values, thus an increase in relative importance and value
  between the 2007 survey to the 2010 survey. This dataset represents the spatial
  change in relative value for California halibut--hook and line commercial fishing
  grounds for the North Central Coast Region.\",\n\t\"license_title\": null,\n\t\"extras\":
